{"operationName":"Pools","variables":{"tokensContain":["0x68037790A0229e9Ce6EaA8A99ea92964106C4703"]},"query":"query Pools($tokensContain: [String]!) {
  pools(
    where: {tokensList_contains: $tokensContain, totalShares_gt: 0.0}
    first: 20
  ) {
    id
    address
    swapFee
    totalShares
    totalWeight
    totalSwapFee
    totalSwapVolume
    totalLiquidity
    tokensList
    tokens(orderBy: weight, orderDirection: desc) {
      id
      address
      balance
      decimals
      symbol
      weight
      __typename
    }
    __typename
  }
}
"}
